def is_prime(n):
    if n == 1:
        return False
    for i in range(2, int(m.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True


def is_semiprime(n):
    if n == 1:
        return False
    for i in range(2, int(m.sqrt(n)) + 1):
        if n % i == 0:
            if is_prime(i) and is_prime(n / i):
                return True
    return False

def is_almost_prime(n):
    if n == 1:
        return False
    count = 0
    for i in range(2, int(m.sqrt(n)) + 1):
        if n % i == 0:
            count += 1
            if count > 1:
                return False
    if count == 1:
        return True
    return False

