        return 0

    if m % 2 == 1 and m % 3 == 1:
        return -1

    steps = 0

    while n != 1:
        if n % 3 == 0:
            n = int(n / 3)
        elif n % 2 == 0:
            n = int(n / 2)
        else:
            return -1
        steps += 1

